import PropTypes from 'prop-types' 

export default function Navbar(props) {
  return (
    <nav className={`navbar navbar-expand-lg bg-dark`}>
        <div className="container-fluid">

        {/* Title on the NavBar */}
        <a className={`navbar-brand text-${props.mode === 'light' ? 'dark':'light'}`} href="/"> <strong>TextUtils</strong></a>

        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
        </button>

        {/* Dark mode Radios */}

        <div className="form-check form-check-inline">
            <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio2" value="option2" onClick={props.lightMode}/>
            <label className={`form-check-label text-${props.mode === 'white' ? 'dark':'light'}`} for="inlineRadio2" >Light mode</label>
        </div>


        <div className="form-check form-check-inline">
            <input className="form-check-input" type="radio" name="inlineRadioOptions" id="inlineRadio1" value="option1" onClick={props.RedMode}/>
            <label className={`form-check-label text-${props.mode === 'white' ? 'dark':'light'}`} for="inlineRadio1" >Red Dark mode</label>
        </div>

